function Cart() {
  return (
    <div>
      <div style={{ marginLeft: "8%" }}>
        <div className="container">
          <div className="col1">
            <h6>Products</h6>
          </div>
          <div className="col2">
            <h6>Price</h6>
          </div>
          <div className="col3">
            <h6>Quantity</h6>
          </div>
          <div className="col4">
            <h6>Total</h6>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cart;

